import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';

function Nav() {
  return (
    <nav>
        <ul className="nav-links">
            <Link><li>Storm</li></Link>
            <Link><li>Wietske</li></Link>
            <Link><li>Sandra</li></Link>
            <Link><li>Rahima</li></Link>
        </ul>
    </nav>
  );
}

export default Nav;
